import "../styles/Users.css";
import mData from "../MOCK_DATA.json";
import {
  useReactTable,
  getCoreRowModel,
  flexRender,
} from "@tanstack/react-table";
import { useMemo } from "react";

const Users = () => {
  /*
    
    "id": 2,
    "name": "Arly",
    "cpf": "191.343.968-19",
    "username": "abelfitt1",
    "status": "Ativo"
  
    */

  const data = useMemo(() => {
    mData;
  }, []);

  /** @type import('@tanstack/react-table').columnDef<any>*/
  const columns = [
    {
      header: "ID",
      accessorKey: "id",
    },
    {
      header: "Nome",
      accessorKey: "name",
    },
    {
      header: "Cadastro Pessoal",
      accessorKey: "cpf",
    },
    {
      header: "Nome de usuário",
      accessorKey: "username",
    },
    {
      header: "Status",
      accessorKey: "status",
    },
  ];

  const table = useReactTable({ data, columns });

  return (
    <div className="container-users">
      <table>
        <thead>
          <tr>
            <th>ID</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Users;
